import React, { Component } from 'react';

const Rank = () => {
	return (
		<div>
			<div className='white f4'>
				{`Rose, your current rank is...`}
			</div>
			<div className='white f1'>
				{`#5`}
			</div>
		</div>
	);
}

export default Rank;
